import * as Yup from "yup"

export const profileSchema = () => {
    return Yup.object().shape({
        lastName: Yup.string().required("Please enter last name"),
        firstName: Yup.string().required("Please enter first name"),
        gender: Yup.string().required("Please select gender"),
        passion: Yup.array(),
        month: Yup.number().max(12).required("Please enter a avlid"),
        day: Yup.number().max(31).required("Please enter day"),
        year: Yup.string().required("Please enter a valid year"),
        email: Yup.string().email().required("Please input a valid email address")
    })
}
